function addSummaryTableEntry(row,sfuncName,result,numberOfIssues,checkName)
    import mlreportgen.dom.*;
    if strcmp(result,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.FAIL))

        im=Image('data:image/png;base64,');
    elseif strcmp(result,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.PASS))

        im=Image('data:image/png;base64,');
    elseif strcmp(result,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.WARNING))

        im=Image('data:image/png;base64,');
    else
        im=Image('data:image/png;base64,');
    end

    table=Table(3);
    table.Style={OuterMargin('35%','30%')};
    table.StyleName='AdvTableNoBorder';
    table.TableEntriesVAlign='middle';
    temprow=TableRow;
    te1=TableEntry(im);

    te2=TableEntry(result);

    te3=TableEntry();
    te3.Style={InnerMargin('3','0','6','0')};
    if~strcmp(result,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.PASS))
        if strcmp(result,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.NOTRUN))...
            &&numberOfIssues==0&&...
            strcmp(checkName,Simulink.sfunction.analyzer.internal.geti18nMessage(Simulink.sfunction.analyzer.internal.ComplianceCheck.ROBUSTNESS_CHECK))
            cateAnchor='RobustnessCheck';
            tss1=['matlab:helpview(fullfile(docroot,''simulink'',''helptargets.map''),'''];
            tss2=[tss1,cateAnchor];
            tss=[tss2,''')'];
            link=ExternalLink(tss,int2str(numberOfIssues));
            te3.append(link);
        else
            te3.append(InternalLink([sfuncName,checkName],int2str(numberOfIssues)));
        end
    end
    append(temprow,te1);
    append(temprow,te2);
    append(temprow,te3);
    append(table,temprow);

    te=TableEntry(table);
    append(row,te);
end